geregisseerd door Ken Scott
met Vince Vaughn, Cobie Smulders en Chris Pratt

David Wozniak (Vince Vaughn) is een spermadonor die onder het pseudoniem &quot;Starbuck&quot; bekend staat bij de spermabank. Op een dag komt hij er achter dat hij al 533 kinderen op aarde heeft gezet. Wanneer een grote groep van hen de spermabank vraag om de identiteit van de donor vrij te geven staat David voor een moeilijke beslissing. Tegelijkertijd probeert zijn vriendin er achter te komen of David wel een geschikte vader is.


